/**
 * CTA Manager - Dashboard Page Entry Point
 *
 * Entry point for the main Dashboard page (cta-manager).
 * The dashboard is the default landing page showing overview and quick actions.
 *
 * When bundled with npm, this file will import:
 * - (Uses global admin modules - no page-specific imports)
 *
 * Dependencies (loaded via admin.js):
 * - CTCAdmin, ctaModalAPI, CTATabs, CTAToast, CTAOnboarding
 *
 * Output: /assets/js/minimized/admin/dashboard.js
 *
 * @package CTA_Manager
 * @since 1.0.0
 */

// ES6 Module Imports (uncomment when bundling with npm)
// No additional imports needed - uses global admin modules

(function ($) {
  'use strict';

  /**
   * Dashboard Page Controller
   */
  window.CTADashboardPage = window.CTADashboardPage || {
    /**
     * Initialize the Dashboard page
     */
    init: function () {
      // Wait for admin app to be ready
      $(document).on('ctaAdminReady', this.onAdminReady.bind(this));

      // If admin is already ready, initialize now
      if (window.CTAAdminApp) {
        this.onAdminReady();
      }
    },
    /**
     * Called when admin app is ready
     */
    onAdminReady: function () {
      this.initQuickActions();
      this.initOverviewCards();

      // Trigger page ready event
      $(document).trigger('ctaDashboardReady', [this]);
    },
    /**
     * Initialize quick action buttons
     */
    initQuickActions: function () {
      // Quick actions are handled by global admin bindings
    },
    /**
     * Initialize overview cards
     */
    initOverviewCards: function () {
      // Overview cards are rendered by PHP
    }
  };

  // Initialize on document ready
  $(function () {
    window.CTADashboardPage.init();
  });
})(jQuery);
